    number: '6'
    value: A redesignation request has been sent for the contribution reported on
      Line 11c for Schedule A from Dave Graham for Governor.  The Party has requested
      redesignation of the $5300.00 contribution to the Partys non-federal account.    With
      respect to the Partys expenditures for payroll, payroll taxes, and other payroll
      or employee benefit-related expenses, the Party adheres to 11 CFR 300.33, and
      also follows the Commissions revision of the rules adopted on December 1, 2005.  Specifically,
      the Party pays for these costs with 100% federal funds when the employee spends
      more than 25% of his or her time in a month on federal election activity (FEA)
      or activity in connection with a federal election.  These expenditures are reported
      on Schedule B for Line 30b.    Alternatively, when an employee does not meet
      the 25% threshold, the Party allocates these costs as an overhead/administrative
      expense, and reports these disbursements on a Schedule H4 for Line 21a.
